<div class="text-container"><span id="t1_13" class="t s0_13">How to obtain model parameters? </span>
<span id="t2_13" class="t s1_13">– </span>
<span id="t3_13" class="t s2_13">Click manually on some representative </span>
<span id="t4_13" class="t s2_13">points for each label </span>
<span id="t5_13" class="t s1_13">– </span>
<span id="t6_13" class="t s2_13">“Train once, apply forever” </span>
<span id="t7_13" class="t s1_13">– </span>

<span id="t9_13" class="t s3_13">✔ </span>

<span id="td_13" class="t s4_13">version) </span>
